-- ==========================================
-- VERIFICAR FACTURAS INSERTADAS
-- ==========================================
PRINT '========================================';
PRINT 'VERIFICACIÓN DE FACTURAS:';
PRINT '========================================';

SELECT 
    COUNT(*) as TotalFacturas,
    MIN(id) as PrimerID,
    MAX(id) as UltimoID,
    SUM(monto_total) as MontoTotalFacturado,
    AVG(monto_total) as PromedioPorFactura
FROM Factura;
GO

